class VDOM_flot(VDOM_object):

	def render(self, parent, contents=""):

		id = 'o_' + (self.id).replace('-', '_')

		result = """<!--[if IE]><script language="javascript" type="text/javascript" src="/e9e1b7c1-2f80-34e3-74a9-b8a9ba2f8ff4.js"></script><![endif]-->"""
		result += """<script language="javascript" type="text/javascript" src="/62b01c3a-180f-ebec-59bf-45dc283b0a29.js"></script>"""

		if self.visible == "1":
			show = ""
		else:
			show = "style='display:none'"

		result += "<div " + show + " id='" + id + "' style='left:"+self.left+"px;top:"+self.top+"px;position:absolute;overflow:hidden;width:"+self.width+"px;height:"+self.height+"px;'>" + contents + "</div>"

		if self.lines == "1":
			lines = "true"
		else:
			lines = "false"

		if self.points == "1":
			points = "true"
		else:
			points = "false"

		if (self.jsondata).strip() == "":
			jsondata = "[]"
		else:
			jsondata = self.jsondata

		result += """<script type='text/javascript'>
var opt_""" + id + """={
	lines: { show: """+lines+""" },
	points: { show: """+points+""" }
};
$j(function(){
	$j.plot($j('#""" + id + """'), """+jsondata+""", opt_""" + id + """);
});
</script>"""

		return VDOM_object.render(self, parent, contents=result)

	def wysiwyg(self, parent, contents=""):

		result="<container id=\"%s\" zindex=\"%s\" hierarchy=\"%s\" order=\"%s\" top=\"%s\" left=\"%s\" width=\"%s\" height=\"%s\">"\
					"<svg>"\
						"<rect x=\"%s\" y=\"%s\" width=\"%s\" height=\"%s\" fill=\"#EFEFEF\" fill-opacity=\".5\" />"\
					"</svg>%s"\
				"</container>"%(
					self.id, self.zindex, self.hierarchy, self.order, self.top, self.left, self.width, self.height,
					0, 0, self.width, self.height,
					contents)

		return VDOM_object.wysiwyg(self, parent, contents=result)
